  import { useState } from "react";


  function State(){
      const [value,setValue]=useState("")
      const [email,setEmail]=useState("")
      const [pswd,setPswd]=useState("")
      const [cpswd,setCpswd]=useState("")
  
      const handleValue=(e)=>{
          setValue(e.target.value)
      }
  
      const handleEmail=(e)=>{
          setEmail(e.target.value)
      }
  
      const handlePswd=(e)=>{
          setPswd(e.target.value)
      }
  
      const handleCpswd=(e)=>{
          setCpswd(e.target.value)
      }
    
  
      const handleSubmit=()=>{
          if(value.length<=5){
              alert("Mustr be enter > 6 character")
          }
          else if(pswd != cpswd){
              alert("password does not match..!")
          }
          else{
              alert("Succes")
          }
      }
  
  
  
  
      return(
          <div>
             <form onSubmit={handleSubmit}>
              <input value={value} type="text" placeholder="Full Name" onChange={handleValue} required/> <br/><br/>
              <input value={email} type="email" required onChange={handleEmail}/><br/><br/>
              <input value={pswd} type="password" required onChange={handlePswd}/><br/><br/>
              <input value={cpswd} type="password" required onChange={handleCpswd}/><br/><br/>
              <input type="submit"/>
             </form>
          </div>
      )
  }
  
  
export default State;
